import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { PokerHeaderComponent } from './poker-header/poker-header.component';

//Components


@NgModule({
  imports: [
    CommonModule
  ],
  declarations: [
    PokerHeaderComponent
  ]
})
export class SharedModule { }
